tables.table_schema:
CREATE TABLE SupplyChainInventory (
    item_id INT PRIMARY KEY,
    item_name TEXT,
    quantity INT,
    location TEXT
);

CREATE TABLE IoTDevices (
    device_id INT PRIMARY KEY,
    device_name TEXT,
    device_type TEXT,
    location TEXT
);

CREATE TABLE Test (
    test_id INT PRIMARY KEY,
    test_name TEXT,
    test_type TEXT
);

CREATE TABLE Products (
    id UUID PRIMARY KEY,
    name STRING,
    price DECIMAL
);

CREATE TABLE Suppliers (
    id UUID PRIMARY KEY,
    name STRING,
    location STRING
);
